import React from "react";

function PrintDetails({ cityData, stateData }) {
  return (
    <>
      {cityData && stateData && (
        <h1>
          selected city name{cityData} and selected state name is :{stateData}
        </h1>
      )}
    </>
  );
}

export default PrintDetails;
